import React, { Component } from 'react';
import Todos from "./Tasks/Todos/Todos";
import Posts from "./Tasks/Posts/Posts";


class Tasks extends Component {
    render() {
        return (
                <div className='missions'>
                    <Todos/>
                    <Posts/>
                </div>
        );
    }
}

export default Tasks;
